import React, { useState } from 'react';
import { InputText } from 'primereact/inputtext';
import { Button } from 'primereact/button';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';

const EditableTable = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [profile, setProfile] = useState([]);
  const [country, setCountry] = useState('');
  const [data, setData] = useState([]);
  const [editingRows, setEditingRows] = useState({});

  const addRow = () => {
    if (!name || !country || !email || !profile)  {
      alert("Please fill in all fields.");
      return;
    }

    setData((prevData) => [
      ...prevData,
      { name, email, profile, country }
    ]);

    // Clear input fields after adding data to the table
    setName('');
    setEmail('');
    setProfile('');
    setCountry('');
  };

  const debounce = (fn, delay) => {
    let timer;
    return function (...args) {
      clearTimeout(timer);
      timer = setTimeout(() => fn.apply(this, args), delay);
    };
  };

  const onRowEditInit = (event) => {
    const rowIndex = event.index;
    let editingRowsCopy = { ...editingRows };
    editingRowsCopy[rowIndex] = { ...data[rowIndex] };
    setEditingRows(editingRowsCopy);
  };

  const onRowEditSave = (event) => {
    const rowIndex = event.index;
    let updatedData = [...data];
    updatedData[rowIndex] = editingRows[rowIndex];
    setData(updatedData);
    setEditingRows({});
  };

  const onRowEditCancel = (event) => {
    setEditingRows({});
  };

  const onEditorValueChange = (props, value) => {
    const rowIndex = props.rowIndex;
    const field = props.field;
    setEditingRows((prevEditingRows) => {
      const updatedRow = { ...prevEditingRows[rowIndex], [field]: value };
      return { ...prevEditingRows, [rowIndex]: updatedRow };
    });
  };

  return (
    <div>
      <h2>Editable Table</h2>
      <form>
        <label htmlFor="name">Name:</label>
        <InputText id="name" value={name} onChange={(e) => setName(e.target.value)} required />

        <label htmlFor="email">Email:</label>
        <InputText id="email" value={email} onChange={(e) => setEmail(e.target.value)} required />

        <label htmlFor="profile">Profile:</label>
        <InputText id="profile" value={profile} onChange={(e) => setProfile(e.target.value)} required />

        <label htmlFor="country">Country:</label>
        <InputText id="country" value={country} onChange={(e) => setCountry(e.target.value)} required />

        <Button type="button" label="Add" onClick={addRow} className="p-button-primary" />
      </form>

      <DataTable
        value={data}
        editMode="row"
        dataKey="email"
        onRowEditInit={onRowEditInit}
        onRowEditSave={onRowEditSave}
        onRowEditCancel={onRowEditCancel}
      >
        <Column field="name" header="Name" editor={(props) => editingRows[props.rowIndex] ? <InputText type="text" value={editingRows[props.rowIndex]['name']} onChange={(e) => onEditorValueChange(props, e.target.value)} /> : props.rowData['name']} />
        <Column field="email" header="Email" editor={(props) => editingRows[props.rowIndex] ? <InputText type="text" value={editingRows[props.rowIndex]['email']} onChange={(e) => onEditorValueChange(props, e.target.value)} /> : props.rowData['email']} />
        <Column field="profile" header="Profile" editor={(props) => editingRows[props.rowIndex] ? <InputText type="text" value={editingRows[props.rowIndex]['profile']} onChange={(e) => onEditorValueChange(props, e.target.value)} /> : props.rowData['profile']} />
        <Column field="country" header="Country" editor={(props) => editingRows[props.rowIndex] ? <InputText type="text" value={editingRows[props.rowIndex]['country']} onChange={(e) => onEditorValueChange(props, e.target.value)} /> : props.rowData['country']} />

        <Column rowEditor style={{ width: '70px' }} />
      </DataTable>
    </div>
  );
};

export default EditableTable;
